import React from "react";
import HomePage from "../src/pages/homepage/homepage.component";
import { Switch, Route } from "react-router-dom";
import "./App.css";

const Testpage = () => (
  <div>
    <h1>test page</h1>
  </div>
);

function App() {
  return (
    <React.Fragment>
      <Switch>
        <Route path="/" component={HomePage} />
        <Route path="/test" component={Testpage} />
      </Switch>
    </React.Fragment>
  );
}

export default App;
